import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div>
      <nav className='navbar navbar-expand navbar-dark bg-dark'>
        <div className='navbar-nav mr-auto'>
          <li className='nav-item'>
            <Link to ={"/"} className="nav-link">Home</Link>
          </li>

        </div>
      </nav>
    </div>
  );
}

export default App;
